import {Routes, Route} from "react-router-dom";
import Dashboard from "../dashboard/Dasboard.js";
import AddProduct from "../addProduct/AddProduct";
import Header from '../../components/header/header'
import Cart from "../cart/cart";
import styles from "./securedContent.module.css";
import PrivateRoute from "../../api/auth/privateRoute";
import { useState } from "react";


const SecuredContent = () => {
    const [searchValue, setSearchValue] = useState('');
    return(
        <div className = {styles.main}>
               <Header onSearch={setSearchValue}/>
               <Routes>
                  <Route path="/dashboard" element={<PrivateRoute><Dashboard searchValue={searchValue}/></PrivateRoute>} />
                  <Route path="/cart" element={<PrivateRoute><Cart/></PrivateRoute>} />
                  <Route path="/addProduct" element={<PrivateRoute><AddProduct /></PrivateRoute>} />
               </Routes>  
        </div>
    )

}

export default SecuredContent;
